bool verify_quad_sol(quad_vec_t *qv) {
  if (isnan(qv->_11) || isnan(qv->_12) || isnan(qv->_21) || isnan(qv->_22)) {
    memset(qv, 0, sizeof(quad_vec_t));
    return false;
  }
  return true;
}

/**
 * @brief     二维卡尔曼滤波
 * @param kf  二维卡尔曼结构体
 * @param U   控制输入
 * @param Z   观测值
 * @ref 完整推导,优质睡前读物():https://www.bilibili.com/video/BV1hC4y1b7K7
 *      建议是合集内的前四个全看完
 * 
 * @author zzq手撕矩阵
 * @details 关键公式:
 *      v_{k} = v_{k-1} + a_{k-1}*dt
 *      a_{k} = a_{k-1} + u_{k-1}
 * 其中v由轮毂电机测的,a由imu测的
 * @attention 这是轮腿的速度观测器 u不为0不是匀加速模型 
 */
dual_vec_t zzq_dual_kalman_update(dual_vec_kf_t *kf, dual_vec_t U, dual_vec_t Z) {
#define $(param) (kf->param)
#define conv_quad(sym)                                                         \
  float sym##1_1 = $(sym)._11, sym##1_2 = $(sym)._12, sym##2_1 = $(sym)._21,   \
        sym##2_2 = $(sym)._22
#define conv_quad_from_kf(sym)                                                 \
        sym##1_1 = $(sym)._11, sym##1_2 = $(sym)._12, sym##2_1 = $(sym)._21,   \
        sym##2_2 = $(sym)._22
#define conv_quad_with_pown(sym, n)                                            \
  float pow##n##of_##sym##1_1 = pow##n##f($(sym)._11),                         \
        pow##n##of_##sym##1_2 = pow##n##f($(sym)._12),                         \
        pow##n##of_##sym##2_1 = pow##n##f($(sym)._21),                         \
        pow##n##of_##sym##2_2 = pow##n##f($(sym)._22)
    
  dual_vec_t zero = {0};

  // 计算先验
  // X_prior(n)=A*X(n-1)+B*U(n-1)
  float X1 = $(X)._11, X2 = $(X)._21;
  float U1 = U._11, U2 = U._21;
  conv_quad(A);
  conv_quad(B);
  $(X) = (dual_vec_t){
      ._11 = B1_1 * U1 + B1_2 * U2 + A1_1 * X1 + A1_2 * X2,
      ._21 = B2_1 * U1 + B2_2 * U2 + A2_1 * X1 + A2_2 * X2,
  };

  // 计算先验误差协方差
  // P_prior(n|n-1)=A*P(n-1|n-1)*A'+Q
  conv_quad(Q);
	conv_quad(P);
  $(P) = (quad_vec_t){
      ._11 = Q1_1 + A1_1*(A1_1*P1_1 + A1_2*P2_1) + A1_2*(A1_1*P1_2 + A1_2*P2_2),
      ._12 = Q1_2 + A2_1*(A1_1*P1_1 + A1_2*P2_1) + A2_2*(A1_1*P1_2 + A1_2*P2_2),
      ._21 = Q2_1 + A1_1*(A2_1*P1_1 + A2_2*P2_1) + A1_2*(A2_1*P1_2 + A2_2*P2_2),
      ._22 = Q2_2 + A2_1*(A2_1*P1_1 + A2_2*P2_1) + A2_2*(A2_1*P1_2 + A2_2*P2_2),
  }; // 手撕,爽!
  if (verify_quad_sol(&$(P)) == false)
    return zero;

  // 计算卡尔曼增益
  // K(n|n-1)=P_prior(n|n-1)*H'/(H*P_prior(n|n-1)*H'+R)
  conv_quad_from_kf(P);
  conv_quad(R);
  conv_quad(H);
  conv_quad_with_pown(H, 2);
  $(K) = (quad_vec_t){
      ._11 =
          (H1_1*P1_1*R2_2 + H1_2*P1_2*R2_2 - H2_1*P1_1*R2_1 - H2_2*P1_2*R2_1 + H1_1*P1_1*P2_2*pow2of_H2_2 - H1_1*P1_2*P2_1*pow2of_H2_2 - H1_2*H2_1*H2_2*P1_1*P2_2 + H1_2*H2_1*H2_2*P1_2*P2_1)/(R1_1*R2_2 - R1_2*R2_1 + P1_1*R1_1*pow2of_H2_1 + P1_1*R2_2*pow2of_H1_1 + P2_2*R1_1*pow2of_H2_2 + P2_2*R2_2*pow2of_H1_2 - H1_1*H2_1*P1_1*R1_2 + H1_1*H1_2*P1_2*R2_2 - H1_2*H2_1*P1_2*R1_2 - H1_1*H2_1*P1_1*R2_1 + H1_1*H1_2*P2_1*R2_2 - H1_1*H2_2*P1_2*R2_1 - H1_1*H2_2*P2_1*R1_2 + H2_1*H2_2*P1_2*R1_1 - H1_2*H2_2*P2_2*R1_2 - H1_2*H2_1*P2_1*R2_1 + H2_1*H2_2*P2_1*R1_1 - H1_2*H2_2*P2_2*R2_1 + P1_1*P2_2*pow2of_H1_1*pow2of_H2_2 + P1_1*P2_2*pow2of_H1_2*pow2of_H2_1 - P1_2*P2_1*pow2of_H1_1*pow2of_H2_2 - P1_2*P2_1*pow2of_H1_2*pow2of_H2_1 - 2*H1_1*H1_2*H2_1*H2_2*P1_1*P2_2 + 2*H1_1*H1_2*H2_1*H2_2*P1_2*P2_1)
 ,
      ._12 =
          -(H1_1*P1_1*R1_2 + H1_2*P1_2*R1_2 - H2_1*P1_1*R1_1 - H2_2*P1_2*R1_1 - H2_1*P1_1*P2_2*pow2of_H1_2 + H2_1*P1_2*P2_1*pow2of_H1_2 + H1_1*H1_2*H2_2*P1_1*P2_2 - H1_1*H1_2*H2_2*P1_2*P2_1)/(R1_1*R2_2 - R1_2*R2_1 + P1_1*R1_1*pow2of_H2_1 + P1_1*R2_2*pow2of_H1_1 + P2_2*R1_1*pow2of_H2_2 + P2_2*R2_2*pow2of_H1_2 - H1_1*H2_1*P1_1*R1_2 + H1_1*H1_2*P1_2*R2_2 - H1_2*H2_1*P1_2*R1_2 - H1_1*H2_1*P1_1*R2_1 + H1_1*H1_2*P2_1*R2_2 - H1_1*H2_2*P1_2*R2_1 - H1_1*H2_2*P2_1*R1_2 + H2_1*H2_2*P1_2*R1_1 - H1_2*H2_2*P2_2*R1_2 - H1_2*H2_1*P2_1*R2_1 + H2_1*H2_2*P2_1*R1_1 - H1_2*H2_2*P2_2*R2_1 + P1_1*P2_2*pow2of_H1_1*pow2of_H2_2 + P1_1*P2_2*pow2of_H1_2*pow2of_H2_1 - P1_2*P2_1*pow2of_H1_1*pow2of_H2_2 - P1_2*P2_1*pow2of_H1_2*pow2of_H2_1 - 2*H1_1*H1_2*H2_1*H2_2*P1_1*P2_2 + 2*H1_1*H1_2*H2_1*H2_2*P1_2*P2_1)
 
 ,
      ._21 =
          (H1_1*P2_1*R2_2 + H1_2*P2_2*R2_2 - H2_1*P2_1*R2_1 - H2_2*P2_2*R2_1 + H1_2*P1_1*P2_2*pow2of_H2_1 - H1_2*P1_2*P2_1*pow2of_H2_1 - H1_1*H2_1*H2_2*P1_1*P2_2 + H1_1*H2_1*H2_2*P1_2*P2_1)/(R1_1*R2_2 - R1_2*R2_1 + P1_1*R1_1*pow2of_H2_1 + P1_1*R2_2*pow2of_H1_1 + P2_2*R1_1*pow2of_H2_2 + P2_2*R2_2*pow2of_H1_2 - H1_1*H2_1*P1_1*R1_2 + H1_1*H1_2*P1_2*R2_2 - H1_2*H2_1*P1_2*R1_2 - H1_1*H2_1*P1_1*R2_1 + H1_1*H1_2*P2_1*R2_2 - H1_1*H2_2*P1_2*R2_1 - H1_1*H2_2*P2_1*R1_2 + H2_1*H2_2*P1_2*R1_1 - H1_2*H2_2*P2_2*R1_2 - H1_2*H2_1*P2_1*R2_1 + H2_1*H2_2*P2_1*R1_1 - H1_2*H2_2*P2_2*R2_1 + P1_1*P2_2*pow2of_H1_1*pow2of_H2_2 + P1_1*P2_2*pow2of_H1_2*pow2of_H2_1 - P1_2*P2_1*pow2of_H1_1*pow2of_H2_2 - P1_2*P2_1*pow2of_H1_2*pow2of_H2_1 - 2*H1_1*H1_2*H2_1*H2_2*P1_1*P2_2 + 2*H1_1*H1_2*H2_1*H2_2*P1_2*P2_1)
 
 ,
      ._22 =
          -(H1_1*P2_1*R1_2 + H1_2*P2_2*R1_2 - H2_1*P2_1*R1_1 - H2_2*P2_2*R1_1 - H2_2*P1_1*P2_2*pow2of_H1_1 + H2_2*P1_2*P2_1*pow2of_H1_1 + H1_1*H1_2*H2_1*P1_1*P2_2 - H1_1*H1_2*H2_1*P1_2*P2_1)/(R1_1*R2_2 - R1_2*R2_1 + P1_1*R1_1*pow2of_H2_1 + P1_1*R2_2*pow2of_H1_1 + P2_2*R1_1*pow2of_H2_2 + P2_2*R2_2*pow2of_H1_2 - H1_1*H2_1*P1_1*R1_2 + H1_1*H1_2*P1_2*R2_2 - H1_2*H2_1*P1_2*R1_2 - H1_1*H2_1*P1_1*R2_1 + H1_1*H1_2*P2_1*R2_2 - H1_1*H2_2*P1_2*R2_1 - H1_1*H2_2*P2_1*R1_2 + H2_1*H2_2*P1_2*R1_1 - H1_2*H2_2*P2_2*R1_2 - H1_2*H2_1*P2_1*R2_1 + H2_1*H2_2*P2_1*R1_1 - H1_2*H2_2*P2_2*R2_1 + P1_1*P2_2*pow2of_H1_1*pow2of_H2_2 + P1_1*P2_2*pow2of_H1_2*pow2of_H2_1 - P1_2*P2_1*pow2of_H1_1*pow2of_H2_2 - P1_2*P2_1*pow2of_H1_2*pow2of_H2_1 - 2*H1_1*H1_2*H2_1*H2_2*P1_1*P2_2 + 2*H1_1*H1_2*H2_1*H2_2*P1_2*P2_1)
 
  }; // 手撕,爽!
  if (verify_quad_sol(&$(K)) == false)
    return zero;

  // 计算后验估计值
  // X(n)=X_prior(n)+K{n|n-1}*(z(n)-H*X_prior(n))
  conv_quad(K);
  X1 = $(X)._11, X2 = $(X)._21;
  float Z1 = Z._11, Z2 = Z._21;
  $(X) = (dual_vec_t){
      ._11 = X1 - K1_1*(H1_1*X1 - Z1 + H1_2*X2) - K1_2*(H2_1*X1 - Z2 + H2_2*X2),
      ._21 = X2 - K2_1*(H1_1*X1 - Z1 + H1_2*X2) - K2_2*(H2_1*X1 - Z2 + H2_2*X2),
  };

  // 更新误差协方差
  // P(n|n-1)=(I-K{n|n-1}*H)*P_prior(n|n-1)
  $(P) = (quad_vec_t){
      ._11 = 
      - P1_1*(H1_1*K1_1 + H2_1*K1_2 - 1) - P2_1*(H1_2*K1_1 + H2_2*K1_2)
 
      ,
      ._12 = 
      - P1_2*(H1_1*K1_1 + H2_1*K1_2 - 1) - P2_2*(H1_2*K1_1 + H2_2*K1_2)
 
      ,
      ._21 = 
      - P1_1*(H1_1*K2_1 + H2_1*K2_2) - P2_1*(H1_2*K2_1 + H2_2*K2_2 - 1)
 
      ,
      ._22 = 
      - P1_2*(H1_1*K2_1 + H2_1*K2_2) - P2_2*(H1_2*K2_1 + H2_2*K2_2 - 1)
 
      ,
  }; // 手撕,爽!
  if (verify_quad_sol(&$(P)) == false)
    return zero;
  return kf->X;
}

dual_vec_t my_dual_kalman_update(dual_vec_kf_t *kf, dual_vec_t U, dual_vec_t Z){
  dual_vec_t zero = {0};
   // 计算先验
   // X_prior(n)=A*X(n-1)+B*U(n-1)
   dual_vec_t X_prior = {0}; // 先验估计
   quad_matvec_mult(&kf->A, &kf->X, &X_prior); // X_prior = A * X
   dual_vec_t temp_U = {0}; // 暂存 U 的结果
   quad_matvec_mult(&kf->B, &U, &temp_U); // B * U
   // X_prior += B * U
   X_prior._11 += temp_U._11;
   X_prior._21 += temp_U._21;
   //  memcpy(&X_prior_debug, &X_prior, sizeof(dual_vec_t));
   // 计算先验误差协方差
   // P_prior(n|n-1)=A*P(n-1|n-1)*A'+Q
   quad_vec_t A_trans = {0}; // A 的转置
   quad_mat_transpose(&kf->A, &A_trans); // A'
   quad_mat_mult(&kf->A, &kf->P, &kf->P); // P_prior = A*P(n-1|n-1)
   quad_mat_mult(&kf->P, &A_trans, &kf->P); // P_prior = temp * A'
   quad_mat_add(&kf->P, &kf->Q, &kf->P); // P_prior += Q
   if(!verify_quad_sol(&kf->P))
    return zero;
   // 计算卡尔曼增益
   // K(n|n-1)=P_prior(n|n-1)*H'/(H*P_prior(n|n-1)*H'+R)
   quad_vec_t H_trans = {0}; // H 的转置
   quad_mat_transpose(&kf->H, &H_trans); // H'
   quad_vec_t tempPH = {0}, tempHPHR = {0}; // 中间变量
   quad_mat_mult(&kf->P, &H_trans, &tempPH); // tempPH = P_prior(n|n-1)*H'
   quad_mat_mult(&kf->H, &kf->P, &tempHPHR); // tempHPHR = H*P_prior(n|n-1)
   quad_mat_mult(&tempHPHR, &H_trans, &tempHPHR); // tempHPHR = tempHPHR * H'
   quad_mat_add(&tempHPHR, &kf->R, &tempHPHR); // tempHPHR += R
  //  memcpy(&tempHPHR_debug, &tempHPHR, sizeof(quad_vec_t));
   quad_mat_inv(&tempHPHR, &tempHPHR);
	 quad_mat_mult(&tempPH, &tempHPHR, &kf->K); // K = tempPH * tempHPHR
   if(!verify_quad_sol(&kf->K))
    return zero; 
   // 计算后验估计
   // X(n)=X_prior(n)+K{n|n-1}*(z(n)-H*X_prior(n))
   dual_vec_t Y = {0}; // 测量残差
   dual_vec_t H_X_prior = {0}; // H * X_prior
   quad_matvec_mult(&kf->H, &X_prior, &H_X_prior); // H * X_prior
   Y._11 = Z._11 - H_X_prior._11; // Y = Z - H * X_prior
   Y._21 = Z._21 - H_X_prior._21;
   dual_vec_t K_Y = {0}; // K * Y
   quad_matvec_mult(&kf->K, &Y, &K_Y); // K * Y
   kf->X._11 = X_prior._11 + K_Y._11; // X_post = X_prior + K * Y
   kf->X._21 = X_prior._21 + K_Y._21;
   // 更新误差协方差 P
   // P(n|n-1)=(I-K{n|n-1}*H)*P_prior(n|n-1)
   quad_vec_t I = {0}; // 单位矩阵
   I._11 = 1; I._12 = 0;
   I._21 = 0; I._22 = 1; 
   quad_vec_t KH = {0}; // K * H
   quad_mat_mult(&kf->K, &kf->H, &KH); // KH = K * H
   // 计算 I - K * H
   quad_vec_t I_KH = {0}; // I - K * H
   quad_mat_sub(&I, &KH, &I_KH); // I_KH = I - K * H
   quad_mat_mult(&I_KH, &kf->P, &kf->P); // P = (I - K * H) * P_prior
   if(!verify_quad_sol(&kf->P))
    return zero; 
   // 返回后验估计
   return kf->X;
}

bool verify_triple_sol(triple_mat_t *tm) {
  for(int i = 0; i < 3; i++){
    for(int j = 0; j < 3; j++){
        if(isnan(tm->_[i][j])){
          memset(tm, 0, sizeof(triple_mat_t));
          return false;
        }
    }
  }
  return true;
}
